INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(19, 3, 'Instant Pot Spaghetti & Meatballs', , 'Making these Instant Pot Spaghetti and Meatballs is so simple. Youâ€™ll start by making meatballs, then browning them in the Instant Pot, adding the spaghetti and marinara, and cooking on high pressure until everythingâ€™s done!', '1 egg\r\nÂ½ cup bread crumbs\r\n2 tablespoons milk\r\n2 tablespoons chopped parsley\r\n1 Â½ teaspoons Italian seasoning\r\nÂ½ teaspoon garlic powder\r\nÂ½ teaspoon salt\r\nÂ½ teaspoon black pepper\r\n1 pound 85% lean ground beef\r\n1 tablespoon olive oil\r\n1 pound spaghetti broken in half\r\n1 (24-ounce) jar marinara sauce\r\n3 cups water\r\nFreshly grated Parmesan cheese for serving\r\nFresh Basil for serving', 'Step 1: Beat the egg in a large bowl. Add the breadcrumbs, milk, parsley, Italian seasoning, garlic powder, salt, and pepper, and stir to combine.\r\nStep 2: Add the ground beef and mix again to combine. Form into meatballs.\r\nStep 3: Once hot, add the olive oil to the Instant Pot, add the meatballs, and cook until browned all over.\r\nStep 4: Add the broken spaghetti directly on top of the meatballs.\r\nStep 5: Add the marinara and water on top of the meatballs; do not stir.\r\nStep 6: Cook on high pressure and release the pressure manually. Stir the pasta and sauce so everything is well combined.\r\n', 6, 5, 40, 'Italian', '4', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(20, 4, 'Vegetable Lasagna', , 'My whole family is obsessed with Vegetable Lasagna. Itâ€™s such a great way to use up extra vegetables at the end of the week. Once the veggies are chopped, cooked, and layered between pasta sauce and lots of cheese, what picky eater would notice mushrooms are in there?', 'Lasagna sheets\r\nOlive oil\r\nOnion\r\nBell pepper\r\nSliced Baby Bella mushrooms\r\nFrozen spinach\r\nGarlic\r\nRicotta cheese\r\nEgg\r\nItalian seasoning\r\nMarinara sauce\r\nMozzarella cheese\r\nParmesan cheese', 'Step 1: Add the ricotta, egg, Italian seasoning, black pepper, and a pinch of salt to a medium bowl.\r\nStep 2: Mix the ricotta mixture until smooth.\r\nStep 3: Add olive oil to a large pot. Add onion, green pepper, and mushrooms and cook until the vegetables have softened and the mushrooms have released all of their moisture.\r\nStep 4: Add the spinach, garlic, and remaining salt.\r\nStep 5: Add a very thin layer of marinara sauce to the bottom of a baking dish.\r\nStep 6: Add a layer of noodles.\r\nStep 7: Add a layer of the vegetable mixture.\r\nStep 8: Dollop the ricotta mixture on top of the veggies, smoothing it into a somewhat even layer.\r\nStep 9: Add a thin layer of marinara on top of the ricotta mixture, then top with mozzarella.\r\nStep 10: Add another layer of noodles. Repeat this layering process two more times so you have a total of three layers. Add the remaining marinara sauce on top of the final layer of noodles, followed by the remaining mozzarella and all of the grated parmesan chees', 12, 20, 65, 'Italian', '2', 'Pending');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(21, 5, 'Taco Pasta Salad', , 'This taco pasta salad was my go-to cold pasta salad this summer! Itâ€™s a taco-rrific mash-up of two of my all-time fav foods, and it was an absolute hit at every poolside party I brought it to. The lime dressing is sooo good! Itâ€™s loaded with taco seasoning and brings all the flavors together. The combo of black beans, corn, and fresh veggies makes it so satisfying. Plus, itâ€™s super easy to make ahead, so I could just grab it from the fridge and head out the door.', 'Lime\r\ngarlic\r\ntaco seasoning\r\nhoney\r\noil\r\nNoodles\r\nBlack beans\r\nBell pepper\r\nTomatoes\r\nCorn\r\nRed onion\r\nCilantro\r\nAvocado', 'Step 1: In a large serving bowl whisk the lime zest and juice, garlic, taco seasoning, honey, salt, and pepper together until combined.\r\nStep 2: Slowly drizzle in the oil, whisking vigorously until emulsified.\r\nStep 3: Add the cooked pasta to a large serving bowl. Toss with the dressing.\r\nStep 4: Add the black beans, bell pepper, cherry tomatoes, corn, red onion, and cilantro to the pasta.\r\nStep 5: Toss until evenly mixed.\r\nStep 6: Chill and add the cubed avocado right before serving.\r\n\r\n', 12, 15, 20, 'Italian', '2', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(22, 4, 'Pistachio Pasta', , 'After eating this Pistachio Pasta for the past 4 days in a row, I can confidently sayâ€¦ I may have a problem. Because, I am already looking forward to eating it for lunch AGAIN tomorrow. Itâ€™s rare that I geek out over pasta, but here I am, and I have Chickapea Pasta to thank! Made from chickpeas and yellow peas ONLY, it has the taste and texture of regular pasta. Itâ€™s so good, and of course, you guys know I love pistachiosâ€¦ which means I should have seen this pistachio pasta obsession coming!', 'Chickapea Pasta\r\nPistachios\r\nFresh Basil Leaves\r\nGreen Onions\r\nGarlic Cloves\r\nLemon Juice\r\nSalt and Black Pepper\r\nExtra-Virgin Olive Oil\r\nMilk of Choice', 'Step 1: Add the pistachios to the blender and chop until finely ground. Remove a couple of tablespoons of the ground pistachios. Set aside.\r\nStep 2: Add the basil, green onions, garlic, lemon juice, salt, pepper, and olive oil continue blending to form a pesto.\r\nStep 3: Add the milk on top of the pesto.\r\nStep 4: Mix until the sauce is completely smooth and creamy. Set aside.\r\nStep 5: After the pasta has cooked, add it back to the pot along with pistachio sauce.\r\nStep 6: Stir frequently until the pasta is warmed through and well combined with the sauce.\r\n', 4, 15, 10, 'Italian', '5', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(23, 3, 'Fettuccine Alfredo', , 'I support jarred pasta sauce as much as the next person, but when it comes to Alfredo sauce, I think homemade is best. My Fettuccine Alfredo has simple ingredients, is ready in less than 30 minutes, and is creamy, cheesy, and delicious.', 'Fettuccine pasta\r\nButter\r\nMilk\r\nGarlic powder\r\nPecorino Romano and Parmesan cheeses', 'Step 1: In a large saucepan, melt the butter.\r\nStep 2: Slowly add the milk, then season it with salt, pepper, and garlic powder.\r\nStep 3: Stir to warm the milk.\r\nStep 4: Transfer the reserved cooked pasta on top of the butter and milk mixture. Add the reserved pasta water and stir until the sauce clings to the pasta.\r\nStep 5: Add the grated cheeses.\r\nStep 6: Stir until the sauce has thickened.\r\n', 8, 5, 20, 'Italian', '4', 'Pending');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(24, 4, 'Ham, Cranberry And Camembert French Toasts', , 'This irresistible ham, cranberry and camembert French toasts recipe is a great dish to enjoy for Boxing Day breakfast. This easy French toast is a great way to use-up leftover Christmas ham.', '4 eggs, at room temperature\r\nÂ¾ cup milk\r\n25g (1/3 cup) finely grated parmesan cheese\r\nSalt and pepper\r\n8 slices sourdough bread\r\nÂ¼ cup (80g) cranberry jelly\r\n4 slices (60g each) leftover Christmas ham\r\n150g leftover camembert, sliced\r\n2 tablespoons seeded mustard\r\nButter, for greasing\r\nExtra seeded mustard, to serve\r\nCornichons, to serve', 'Step 1 - Preheat oven to 120Â°C fan forced. Whisk eggs, milk, parmesan, salt and pepper together in a shallow dish.\r\nStep 2 - Spread one side of half the bread slices with cranberry jelly and top with ham and camembert. Spread remaining bread with mustard and sandwich together.\r\nStep 3 - Grease a large non-stick frying pan with butter and melt over medium heat. Dip 2 sandwiches into the egg mixture for about 15 seconds each side.\r\nStep 4 - Add to pan and cook for 2-3 minutes each side or until golden brown. Transfer to an oven tray in the oven to keep warm. Repeat with remaining butter, egg mixture and sandwiches.\r\nStep 5 - Slice French toast in half and serve with extra mustard and cornichons.', 4, 10, 15, 'French', '4', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(25, 3, 'French Toast With Berry Compote', , 'A serve of French Toast with Berry Compote is a good source of fibre, folate and iron and a source of vitamin A.', '4 eggs\r\n4 slices wholegrain bread\r\n1/2 cup low fat milk\r\n1 pinch ground cinnamon\r\n1 tsp polyunsaturated margarine\r\n1 cup berries (any type, fresh or frozen)\r\n2 tbsp brown sugar', 'Step 1 - Whisk eggs, milk and cinnamon until combined\r\nStep 2 - Heat a non-stick fry pan and melt margarine\r\nStep 3 - Dip bread into egg mixture and fry gently on both sides for about 2-3 minutes\r\nStep 4 - Add berries to a small saucepan, add sugar and bring to a gentle simmer, be mindful not to overcook the berries\r\nStep 5 - Place French toast on to plates and serve with berries', 2, 5, 5, 'French', '3', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(26, 5, 'Eggy French Toast With Berries', , 'French toast is perfect for Motherâ€™s Day or other special breakfast-in-bed mornings.', '4 large eggs, at room temperature\r\n3/4 cup reduced fat milk\r\n1/4 cup caster sugar\r\n1/2 tsp vanilla extract\r\nButter, for greasing pan\r\n6-8 slices day-old thick white bread\r\nStrawberries and blueberries, to serve\r\nIcing sugar, for dusting', 'Step 1 - Preheat oven to 120Â°C/100Â°C fan-forced. Whisk eggs, milk, sugar and vanilla in a medium shallow dish\r\nStep 1 - Grease a large non-stick frying pan with butter and melt over medium heat. Dip 2 bread slices into egg mixture for about 15-20 seconds on each side\r\nStep 1 - Add to pan and cook for 2-3 minutes on each side until light golden brown. Transfer to a tray and keep warm in the oven. Repeat with extra butter, remaining bread and egg mixture\r\nStep 1 - Place French toast onto serving plates. Top with strawberries and blueberries, lightly dust with icing sugar and serve', 4, 15, 10, 'French', '1', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(27, 3, 'Baked Mushrooms With French Toast', , 'This baked mushrooms with french toast is a quick and easy brunch, appetiser or even lunch recipe idea. This dish will quickly become a favourite with it\'s hearty flavour.', '4 large flat or Portabella mushrooms\r\n1 tbs olive oil\r\n2 tbs maple syrup\r\n2 eggs\r\n2 tbs milk\r\n40g butter\r\n4 thick slices wholegrain bread\r\nThyme sprigs', 'Step 1 - Preheat oven to 240Â°C or 220Â°C fan forced. Place mushrooms, stem side-down, in a greased roasting pan\r\nStep 2 - Combine oil and maple syrup in a bowl. Brush mixture over both sides of mushrooms. Roast 15-20 minutes or until tender\r\nStep 3 - Beat eggs and milk together in a shallow dish. Melt half the butter in a large non-stick frying pan over medium heat. Dip two slices bread into the egg mixture, allowing any excess to drain off\r\nStep 4 - Cook 1-2 minutes each side until golden. Keep warm in oven while you cook remaining French toast\r\nStep 5 - Place 1 mushroom on top of each French toast, top with thyme and serve, drizzle with a little extra maple syrup if desired', 4, 5, 20, 'French', '2', 'Pending');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(28, 5, 'French Toast With Hollandaise Sauce', , 'Add a twist of Hollandaise to create a fancy, tasty breakfast.', 'Birch & Waite Hollandaise Sauce\r\n4 slices of your favourite bread\r\n3 eggs\r\n2 tablespoons milk\r\nSalt / pepper\r\nButter\r\nTomatoes', 'Whisk eggs, milk and seasoning in a bowl until combined. Transfer mixture to a flat, shallow container so the bread can be easily dipped\r\nPreheat fry pan\r\nDip bread for 30 seconds, turn over and dip remaining side for another 30 seconds\r\nAdd a little butter to pan before adding bread. Fry until golden, turn cook remaining side\r\nServe with pan fried tomatoes and a dipping tub of warmed hollandaise. Hollandaise Sauce can be warmed in the microwave oven - just 10 or 20 seconds for a small portion', 2, 10, 10, 'French', '1', 'Pending');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(29, 4, 'Chinese Pork Open Omlete', , 'This Chinese egg omelette makes a quick and easy meal with pork mince. It\'s packed full of veggies too, including mushrooms, cabbage and beansprouts to make a healthy meal.', '2 tablespoons light soy sauce\r\n2 tablespoons hoisin sauce\r\n1 teaspoon sesame oil\r\n1 chicken stock cube, crumbled\r\n1 cup (250ml) water\r\n1 tablespoon cornflour\r\nÂ¼ cup vegetable oil\r\n3 cloves garlic, crushed\r\n1Â½ tablespoons ginger paste\r\n300g pork mince\r\n100g white mushrooms, chopped\r\n2 cups (160g) shredded Chinese cabbage\r\n3 green onions, shredded, plus extra for garnish\r\n2 cups (110g) bean sprouts, plus extra to serve\r\n8 eggs\r\n1 teaspoon salt\r\n2 tablespoons toasted sesame seeds', 'Step 1 - Combine soy, hoisin, sesame oil, stock cube and water into a saucepan. Bring to a boil, stirring over a medium heat for 2 minutes. Add cornflour and cook for 3 minutes or until sauce thickens to a thin gravy consistency\r\nStep 2 - Heat 1 tbsp oil in a small non-stick frying pan. Add garlic and ginger. Cook, stirring, for 30 seconds or until fragrant. Add pork mince and cook, stirring, using a wooden spoon to break up any lumps until browned. Add mushrooms and cabbage and cook, stirring, for 4-5 minutes or until softened\r\nStep 3 - Add green onions and sprouts and cook a further 2-3 minutes. Remove from heat and place in a heatproof bowl. Set aside and keep warm. Wipe pan clean\r\nStep 4 - Whisk eggs together and season with salt\r\nStep 5 - Heat 2 teaspoons of oil in the same pan over medium heat. Add Â¼ of the egg mixture and cook for 2-3 minutes, tilting the pan to form a round omelette. Turn over and cook for a further 1 minute or until the egg is set. Turn out onto a plate. Repea', 4, 15, 25, 'Chinese', '1', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(30, 3, 'Chicken Fried Rice With Sliced Egg Omelette', , 'Easy chicken fried rice recipe with egg omelette. This egg filled fried rice is ready in 30 minutes for a quick and easy weekday dinner.', '2 tablespoons peanut oil\r\n4 eggs, lightly beaten\r\n250g chicken breast, thinly sliced\r\n1 red capsicum, diced\r\n150g (1 cup) frozen peas\r\n4 shallots, thinly sliced\r\n150g sugar snap peas, blanched\r\n2 garlic cloves, crushed\r\n450g pkt microwave jasmine rice, warmed\r\nÂ¼ cup (60ml) kecap manis (sweet soy sauce)\r\n2 tablespoons Chinese rice wine\r\n1 teaspoon sesame oil\r\nToasted sesame seeds, to serve', 'Step 1 - Heat 2 teaspoons peanut oil in a wok or large deep non-stick frying pan over medium heat. Add 2 eggs and swirl around the pan to form a thin omelette. Cook for 1-2 minutes or until just set. Transfer to a board, roll and slice thinly. Repeat with 2 teaspoons oil and remaining eggs to make 2 omelettes.\r\nStep 2 - Add remaining peanut oil to wok and return to high heat. Stir-fry chicken for 2-3 minutes or until golden. Add capsicum, peas, half the shallots, sugar snap peas and the garlic and stir-fry for 1-2 minutes or until just tender. Add rice and stir-fry for 2 minutes or until heated through.\r\nStep 3 - Mix together half the kecap manis, rice wine and sesame oil and add to the wok, tossing gently until well combined. Fold through half the sliced omelette.\r\nStep 4 - To serve, divide the rice between bowls and top with remaining sliced omelette, remaining shallots and scatter of sesame seeds. Drizzle with remaining kecap manis.', 4, 15, 15, 'Chinese', '3', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(31, 5, 'Tea Eggs With Asian Noodles', , 'This easy Tea Eggs recipe served with Asian noodles is a wonderful dish to celebrate Chinese New Year. Plus these tea eggs make for a show stopping dish to serve at your next dinner party.', '1 tablespoon Chinese five spice\r\n1 cup (250ml) dark soy\r\n3/4 cup brown sugar\r\nÂ¼ rice wine vinegar\r\n2 black tea bags\r\n2 cups (500ml) water\r\n8 eggs, at room temperature\r\n350g fresh egg noodles\r\n2 tablespoons sesame oil\r\n1 bunch broccolini, trimmed\r\n200g Asian mushrooms chopped\r\n1 tablespoon sliced ginger\r\n4 green onions, shredded\r\n1 long red chilli, thinly sliced\r\nBaby purple shiso, optional, to serve', 'Step 1 - Place Chinese five spice, soy, brown sugar, vinegar and tea bags in a medium saucepan. Add the water and bring to the boil over high heat.\r\nStep 2 - Add the eggs and cook for 3 minutes. Carefully remove with a slotted spoon. Place in a bowl and gently tap the shell with the back of a spoon. Return the eggs to the boiling cooking liquid and remove from heat. Cover and leave for at least 2 hours to marinate and cool.\r\nStep 3 - Remove 1 cup of the cooking liquid and set aside. Discard remaining cooking liquid.\r\nAsian noodles\r\nStep 4 - Cook noodles according to packet instructions. Refresh and set aside.\r\nStep 4 - Heat oil in a large wok or frying pan. Add broccolini and cook for 3 minutes, then add mushrooms. Cook for another 3 minutes. Add ginger and reserved cooking liquid and cook for 1 minute.\r\nStep 5- To serve, peel the eggs and halve some of them. Divide noodles and vegetables between bowls. Drizzle with cooking liquid. Top with eggs, scatter with green onions, chilli and s', 4, 15, 20, 'Chinese', '3', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(32, 4, 'Beef And Cashew Lettuce Cup', , 'Easy stir-fry beef with cashews made healthier using lean beef as a valuable source of iron and protein.', '1 tablespoon vegetable oil\r\n600g rump steak, fat trimmed, thinly sliced\r\n800g stir-fry vegetables (see tip)\r\n175g pkt Celebrate Health Chinese Stir-Fry Recipe Base\r\n8 Iceberg lettuce cups\r\nâ…“ cup (50g) roasted unsalted cashew nuts, coarsely chopped (see tip)', 'Heat half of the oil over high heat. Stir-fry beef in 2 batches for 1-2 minutes or until browned. Transfer to a plate\r\nReheat wok over high heat and add the remaining oil. Stir-fry vegetables for 3-4 minutes or until almost tender. Return beef to the wok with Celebrate Health Chinese Stir-Fry Recipe Base and stir-fry for 1-2 minutes or until hot\r\nServe stir-fry in lettuce cups sprinkled with the cashews', 4, 5, 15, 'Chinese', '2', 'Pending');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(33, 5, 'Sesame Chicken Stir Fry With Ginger & Chinese Five Spice', , 'Sesame Chicken Stir Fry with Ginger & Chinese Five Spice is a flavorful dish combining tender chicken, crisp vegetables, and a savory, aromatic sauce with a hint of warmth from ginger and Chinese five spice.', '800g chicken stir-fry strips\r\n4 tbsp. Kikkoman Roasted Garlic & Soy Marinade & Stir Fry Sauce\r\n1 tbsp. rice wine vinegar\r\n1 tsp. finely grated fresh ginger\r\n1/2 tsp. Chinese five spice powder\r\n2 tbsp. (40 mL) vegetable oil\r\n1 bunch spring (green) onions, trimmed, cut into 3cm pieces\r\n200g French beans, halved lengthways, then cut into 3 pieces crossways\r\n1 small red onion, cut into thin wedges\r\n1 cup whole baby sweet corn\r\n1/2 cup (125mL) salt reduced beef stock\r\n2 extra tablespoons (40mL) Roasted Garlic & Soy Marinade & Stir Fry Sauce\r\n1 tsp. sesame oil\r\n1 tsp. corn flour\r\nWater\r\nSliced mild red chilli, to serve (optional)\r\nToasted sesame seeds, to serve\r\nSteamed jasmine rice, to serve', 'Step 1 - Combine Roasted Garlic & Soy Marinade, rice vinegar, ginger and Chinese five spice in a large bowl and stir until mixed well. Add the chicken and stir until fully coated. Cover and refrigerate for 20 minutes. (For a deeper flavour marinate for approx. 2 hrs.)\r\nStep 2 - Meanwhile, prepare the sweet corn, spring onions, French beans and onion\r\nStep 3 - Heat the oil in a wok over high heat. Add chicken mixture and stir fry in batches for about 3 minutes or until brown, taking care not to burn. Transfer each batch to a plate and cover with foil to keep warm\r\nStep 4 - Add spring onion, beans, red onion and corn to wok and stir fry for about 2 minutes or until onion is soft, but still tender. Add chicken, stock, extra Roasted Garlic & Soy Marinade and sesame oil. Bring to the boil\r\nStep 5 - Combine corn flour and a little cold water in a small bowl. Mix well. Add to the stirfry mixture and cook, uncovered, stirring occasionally for 3 minutes or until sauce thickens slightly\r\nStep 6 ', 4, 20, 20, 'Chinese', '3', 'Pending');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(34, 4, 'Japanese Pork Katsu With Homemade Sauce', , 'Make this delicious recipe for Japanese Katsu with Homemade Sauce for weeknight meals the whole family will enjoy.', '4 pork cutlets, approx. 1kg in total\r\n1 cup plain flour\r\n2 eggs\r\n1 cup panko bread crumbs\r\n1 cup peanut or vegetable oil\r\nSalt and freshly ground pepper to taste\r\n2 tbsp Kikkoman Japanese Barbecue Marinade and Stir Fry Sauce\r\n2 tbsp Worcestershire sauce\r\n1/4 cup ketchup\r\nSteamed rice, shredded cabbage and cherry tomatoes', 'Step 1 - Place cutlets between plastic wrap and pound to a 2cm thickness. Remove the plastic and season each side of the cutlets with salt and pepper\r\nStep 2 - Place the flour, eggs and breadcrumbs in separate shallow bowls. Dip each cutlet in the flour, patting off any excess. Then dip each in the egg and let drain well and then coat with the breadcrumbs\r\nStep 3 - Place a heavy saute pan on medium heat and add the oil. Fry cutlets on each side for approx. 3-5 minutes or until pork is cooked through\r\nStep 4 - Make certain not to over crowd the pan. Fry cutlets in batches if necessary. Set on paper towel to drain excess oil\r\nStep 5 - To make the sauce, place ingredients into a small bowl and combine well\r\nTo serve\r\nStep 6 - To assemble, place sliced pork onto individual bowls of rice and drizzle with the sauce\r\nStep 7 - Serve with the cabbage, tomatoes and extra sauce on the side', 4, 10, 10, 'Japanese', '3', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(35, 3, 'Fluffy Japanese Pancakes', , 'Make fluffy Japanese soufflÃ© pancakes from scratch, with or without a pancake mold', '3 eggs\r\n1 tbsp milk\r\n1 tsp vanilla extract\r\nÂ¼ cup (35g) plain flour\r\n1 tsp baking powder\r\nÂ½ tsp cream of tartar\r\nÂ¼ cup (55g) caster sugar\r\nVegetable oil for greasing\r\nWater for steaming\r\nIcing sugar, maple syrup and berries, to serve', 'Step 1 - Separate eggs and place egg whites into a large mixing bowl. Chill in refrigerator for as long as possible\r\nStep 2 - Meanwhile, whisk egg yolks, milk and vanilla together until thick and frothy. Sift in flour and baking powder and whisk until it forms a thick batter. Set aside\r\nStep 3 - Place egg whites and cream of tartar into the bowl of an electric mixer and whisk on medium speed until frothy and eggs turn a pale colour\r\nStep 4 - Gradually add sugar, a little at a time until egg whites become firm, glossy and forms stiff peaks\r\nStep 5 - Whisk â…“ of the egg whites into the egg yolk mixture and mix well to loosen batter. Add remaining egg white in two batches, whisking gently to avoid over beating. Batter should be thick and airy\r\nStep 6 - Heat frying pan on the smallest hob over low heat for 10 minutes. This is to saturate the frying pan with even heat\r\nStep 7 - RING METHOD: Brush pan and the inside of three (7cm diameter x 5cm high) metal rings with vegetable oil. Rub off ex', 2, 15, 25, 'Japanese', '2', 'Active');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(36, 4, 'Japanese Noodle Broth With Salmon & Spinach', , 'A delicious recipe and shows you how to make a Japanese Noodle Broth soups.', '6 cups (1.5 L) salt reduced chicken stock\r\n1/3 cup (100g) white miso paste\r\n2 tablespoons (60mL) Kikkoman Less Salt Soy Sauce\r\n200g shelf-fresh udon noodles\r\n4 spring (green) onions, trimmed and cut into 3 cm lengths\r\n1 bunch baby spinach, trimmed\r\nOlive oil spray\r\n2x 150g (approx.) salmon fillets, skin removed, each fillet cut into 4 pieces cross-ways\r\n1 tablespoon sesame seeds\r\nExtra spring (green) onions, thinly sliced, to serve', 'Step 1 - Place chicken stock in a large saucepan and bring to the boil. Add miso paste and stir until it dissolves. Add Less Salt Soy Sauce. Reduce heat to a gentle simmer\r\nStep 2 - Add the noodles and cook until just soft (1-2 minutes). Add the spring onion and cook for about 1 minute. Add the spinach and turn off the heat. (The spinach will cook in the hot broth)\r\nStep 3 - Heat a non-stick fry pan over medium/high heat. Spray with the oil. Cook the salmon pieces for 2-3 minutes each side for medium or until the fish flakes easily when tested with a fork\r\nStep 4 - Flake the salmon into large pieces with a fork. Divide the broth and noodles among serving bowls. Place salmon pieces on top\r\nStep 5 - Drizzle with extra soy sauce and top with extra sliced spring onions. Sprinkle with the sesame seeds', 4, 10, 5, 'Japanese', '1', 'Pending');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(37, 4, 'Japanese Egg Salad', , 'Put this simple egg salad recipe into a white bread sandwich for an easy Japanese-inspired lunch or picnic snack.', '6 extra-large eggs (approx. 59g each)\r\n4 tablespoons Kewpie mayonnaise\r\n2 teaspoons wasabi paste\r\n2 teaspoons milk\r\n1 teaspoon salt\r\nÂ½ teaspoon sugar\r\n1 bunch fresh chives, chopped', 'Step 1 - Grease a shallow baking dish (4-cup capacity) that fits inside a large deep pan with a lid. Crack eggs into baking dish so that eggs are in a single layer. Place inside pan. Fill pan with enough water to come 1cm up the sides\r\nStep 2 - Cover with lid and cook over medium-high heat for 6-7 minutes. Turn off heat and let stand for 2-3 minutes with the lid on\r\nStep 3 - Transfer eggs to a chopping board. Coarsely chop with a sharp knife. Transfer to a bowl. Stir in mayonnaise, wasabi, milk, salt, sugar and half of the chopped chives. Sprinkle with remaining chives to serve\r\n', 4, 10, 15, 'Japanese', '2', 'Pending');
INSERT INTO `recipe` (`Recipe_ID`, `Creator_ID`, `Recipe_Name`, `Image`, `Description`, `Ingredients`, `Method`, `Serves`, `Prepare_Time`, `Cook_Time`, `Cuisine`, `Difficulty`, `Status`) VALUES
(38, 5, 'Teriyaki Roast Kingfish With Cucumber And Enoki Japanese Salad', , 'Teriyaki Roast Kingfish with Cucumber and Enoki Japanese Salad is a flavorful dish featuring succulent roasted kingfish glazed with teriyaki sauce, served alongside a refreshing cucumber and enoki mushroom salad for a perfect balance of savory and crisp textures.', '4 kingfish fillets (190g each)\r\n60 ml (1/4 cup) Kikkoman Teriyaki Sauce\r\n3 Lebanese cucumbers, seeds removed, sliced into ribbons\r\n80 g enoki mushrooms, trimmed\r\n3 spring onions, thinly sliced\r\n1 punnet baby shiso, trimmed (optional)\r\n1 cup coriander (loosely packed), coarsely torn\r\n2 tbsp pickled ginger, thinly sliced\r\nToasted sesame seeds, to serve\r\n60 ml (1/4 cup) Kikkoman Naturally Brewed Soy Sauce\r\n10 ml each mirin and rice wine vinegar\r\n5 g (1cm piece) ginger, finely grated\r\n10 ml sesame oil\r\n20 ml ground nut oil\r\nPinch of caster sugar', 'Step 1 - Brush kingfish with Kikkoman Teriyaki Sauce, place in a non-reactive container and refrigerate for flavours to develop (5 hours- overnight)\r\nStep 2 - Make sesame and soy dressing and set aside\r\nStep 3 - Preheat oven to 180Â°C. Preheat a char-grill (BBQ) over medium-high heat, drizzle kingfish with oil and grill, brushing with marinade, turning once until charred (1-2 minutes each side).\r\nStep 4 - Transfer to a tray lined with baking paper and roast until just cooked through (8-10 minutes). Combine cucumber, enoki, spring onion, baby shiso, coriander and pickled ginger in a bowl, drizzle over three-quarters of the dressing and toss to combine.\r\nStep 5 - Serve with teriyaki kingfish with extra dressing drizzled over if desired and scattered with sesame seeds\r\nStep 6 - For sesame and soy dressing, whisk together ingredients in a small bowl and set aside', 4, 30, 10, 'Japanese', '5', 'Active');

